import React from "react";
import Header from "./components/Header/Header";
import Slidetop from "./components/Slidetop/Slidetop";
import Listcorse from "./components/ListCourse/Listcourse";
import Listvideocorse from "./components/Listvideocourse/listvideocourse";
import Footer from "./components/Footer/Foter";
import Imagactive from "./components/Imgactive/Imgactive";

function Home() {
  return (
    <div>
      <Header />
      <Slidetop />
      <CourseList />
      <Listvideocorse />
      <Imagactive />
      <Footer />
    </div>
  );
}

export default Home;
